import React from 'react';
import './client.css';
import ClientHeader from './ClientHeader';
import ClientSidebar from './ClientSidebar';
import Tabs from './Tabs';
import { Link } from 'react-router-dom';

function ClientProjects() {
    const projects =[
        {id:"1", name:'hospital'},
        {id:"2", name:'church'}
    ]
    var projects_HTMLTBL = "";
    projects_HTMLTBL = this.state.projects.map((item) => {
        return (
            <tr key={item.id}>
                <td>{item.id}</td>
                <td>{item.name}</td>
            </tr>
        );
    });
    return (
        <div className='container'>
            <ClientHeader />
            <ClientSidebar />
            <Tabs>
                <div label="On-Going" className='tab-content'>
                    <div className="row">
                        <div className="col-md-12">
                            <div className="card">
                                <div className="card-header">
                                    <h4>
                                        Student Data
                                        <Link to={'add-student'} className="btn btn-primary btn-sm float-end">Add Student</Link>
                                    </h4>
                                </div>
                                <div className="card-body">
                                    <table className='table table-bordered table-striped'>
                                        <thead>
                                            <tr>
                                                <th>ID</th>
                                                <th>Name</th>
                                                <th>Course</th>
                                                <th>Phone</th>
                                                <th>Email Id</th>
                                                <th>Edit</th>
                                                <th>Delete</th>
                                            </tr>
                                        </thead>
                                        <tbody>
                                            {projects_HTMLTBL}
                                        </tbody>
                                    </table>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
                <div label="Completed" className='tab-content'>
                    <em>Completed</em> Projects!
                </div>
                <div label="All" className='tab-content'>
                    <em>All</em> Projects!
                </div>
            </Tabs>
        </div>
    );
}

export default ClientProjects;
